$(document).ready(function(){
  var cost = document.getElementById('cost').getAttribute('value');
  $('#order_rental_period').on('change',function() {
    var hours = $('#order_rental_period').val();
    $('#cost').html(cost * hours);
    document.getElementById('order_cost').value = cost * hours;
  });
})
